import React, { Component } from "react";
import Page from "./page";

class Pagenation extends Component {
  render() {
    const { numberOfPages, pageClick } = this.props;
    return (
      <nav aria-label="Page navigation">
        <ul className="pagination justify-content-center">
          {this.renderPages(numberOfPages, pageClick)}
        </ul>
      </nav>
    );
  }

  renderPages(numberOfPages, pageClick) {
    let pages = [];
    for (let i = 0; i < numberOfPages; i++) {
      pages.push(
        <Page
          key={"Page-" + (i + 1)}
          pageClick={pageClick}
          pageNumber={i + 1}
          pageText={i + +1}
        />
      );
    }
    return pages;
  }
}

export default Pagenation;
